class Solution:
	# @param A : tuple of integers
	# @param B : tuple of integers
	# @param C : tuple of integers
	# @return an integer
	def minimize(self, A, B, C):
		L1,L2,L3 = len(A),len(B),len(C)
		P1,P2,P3 = 0,0,0
		ans = max(abs(A[0] - B[0]), abs(B[0] - C[0]), abs(C[0] - A[0]))
		#print "ans",ans
		while P1 < L1-1  or P2 < L2-1 or P3 < L3-1 :
			ans = min(ans,self.count(A,B,C,P1,P2,P3))
			min_num=min([(x[y],i) for (x,y,z,i) in [(A,P1,L1,1),(B,P2,L2,2),(C,P3,L3,3)] if y<z-1])[1]
			#min_num = max(A[P1],B[P2],C[P3])
			#if P1 < L1-1 : min_num=min(min_num,A[P1])
			#if P2 < L2-1 : min_num=min(min_num,B[P2])
			#if P3 < L3-1 : min_num=min(min_num,C[P3])
			#print L1,L2,L3,P1,P2,P3,A[P1],B[P2],C[P3]
			if min_num == 1 : P1+=1
			elif min_num == 2 : P2+=1
			elif min_num == 3 : P3+=1
		return ans

	def count(self,A,B,C,i,j,k):
		#print "count",i,j,k,len(A),len(B),len(C), A[i],B[j],C[k]
		return max(abs(A[i] - B[j]), abs(B[j] - C[k]), abs(C[k] - A[i]))

